How to create a mongoose query that supports empty values and returns all<p>The user has a form to fill and search for documents in a mongoDB collection.
The user doesnt need to fill all inputs of the form, but the ones that the user has filled need to be queried together. The inputs the user has not filled go to the backend as "" an empty string.</p>

<p>my query goes like this:</p>

<pre><code>let cf = await Cf.find({
            $and: [
                {userId: userId},
                {$and: [
                    {name: name == '' ? null : name},
                    {catg: catg == '' ? null : catg},
                    {value: value == '' ? null : value}
                ]}
            ]
        });
</code></pre>

<p>So, for the query i set a condition that if the values are equal to "" than I change it to <code>null</code>, but mongoose is actually searching for null values. Is there some sort of empty placeholder that gets back all documents?
If I leave as an empty string or change it to <code>undefined</code> it also does not work.</p>

<p>what would be the best approach if the user has left some empty fields?</p>

<p><strong>UPDATE</strong></p>

<p>Using mickl's logic and a few tweaks, it worked perfectly.
here is the final result.</p>

<pre><code>        let query = {
                    $and: [
                        {userId: userId}
                    ]
                };

        let subQuery = [];

        if (name !== ''){
            subQuery.push({name: name})
        };

        if (catg !== ''){
            subQuery.push({catg: catg})
        };

        if (value !== ''){
            subQuery.push({value: value})
        };

        if( name !== '' || catg !== '' || value !== ''){
            query.$and.push({$and: subQuery})
        };

        let cf = await Cf.find(query);
</code></pre>

